css:
atom-text-editor,
:host {
  background-color: #282828;
  color: #f8f8f2;
}
atom-text-editor .invisible-character,
:host .invisible-character {
  color: rgba(197, 200, 198, 0.2);
}
atom-text-editor .indent-guide,
:host .indent-guide {
  color: rgba(255, 255, 255, 0.15);
}
atom-text-editor .wrap-guide,
:host .wrap-guide {
  background-color: rgba(255, 255, 255, 0.1);
}
atom-text-editor .gutter,
:host .gutter {
  background-color: #303030;
}
atom-text-editor .line-number.cursor-line-no-selection,
:host .line-number.cursor-line-no-selection {
  background-color: #49483e;
}
atom-text-editor .invisible,
:host .invisible {
  color: #f8f8f2;
}
atom-text-editor .cursor,
:host .cursor {
  border-color: #f8f8f0;
}
atom-text-editor .selection .region,
:host .selection .region {
  background-color: #49483e;
}
atom-text-editor .search-results .marker .region,
:host .search-results .marker .region {
  background-color: transparent;
  border: 1px solid #888888;
}
atom-text-editor .search-results .marker.current-result .region,
:host .search-results .marker.current-result .region {
  border: 1px solid #ffffff;
}
atom-text-editor .gfm .markup.heading,
:host .gfm .markup.heading {
  color: #a6e22e;
  font-weight: bold;
}
atom-text-editor .gfm .markup.underline,
:host .gfm .markup.underline {
  color: #e6db74;
  text-decoration: underline;
}
atom-text-editor .gfm .bold,
:host .gfm .bold {
  font-weight: bold;
}
atom-text-editor .gfm .italic,
:host .gfm .italic {
  font-style: italic;
}
atom-text-editor .gfm .raw,
:host .gfm .raw {
  color: #66d9ef;
}
atom-text-editor .gfm .variable.list,
:host .gfm .variable.list {
  color: #f92672;
  font-weight: bold;
}
atom-text-editor .gfm .link,
:host .gfm .link {
  color: #cccccc;
}
atom-text-editor .gfm .link .entity,
:host .gfm .link .entity {
  color: #ae81ff;
}
.comment {
  color: #75715e;
}
.constant.numeric {
  color: #ae81ff;
}
.constant.language {
  color: #ae81ff;
}
.constant.character,
.constant.escape,
.constant.other {
  color: #ae81ff;
}
.constant.type {
  font-style: italic;
  color: #66d9ef;
}
.entity.name.class {
  text-decoration: none;
  color: #a6e22e;
}
.entity.other.inherited-class {
  font-style: italic;
  text-decoration: none;
  color: #a6e22e;
}
.entity.name.function {
  color: #a6e22e;
}
.entity.name.instance {
  color: #66d9ef;
}
.entity.name.tag {
  color: #f92672;
}
.entity.other.attribute-name {
  color: #a6e22e;
}
.invalid {
  color: #f8f8f0;
  background-color: #f92672;
}
.invalid.deprecated {
  color: #f8f8f0;
  background-color: #ae81ff;
}
.keyword {
  color: #f92672;
}
.keyword.operator.bracket,
.keyword.operator.punctuation {
  color: #ffffff;
}
.leading-whitespace,
.trailing-whitespace {
  display: inline-block;
}
.meta.class {
  color: #f7b32a;
}
.meta.class.body {
  color: #f8f8f2;
}
.meta.method-call,
.meta.method {
  color: #f8f8f2;
}
.meta.definition.variable {
  color: #ec3533;
}
.meta.link {
  color: #f6aa11;
}
.meta.require {
  color: #66d9ef;
}
.meta.selector {
  color: #ae81ff;
}
.meta.separator {
  background-color: #373b41;
  color: #f8f8f2;
}
.meta.tag {
  color: #f8f8f2;
}
.punctuation.definition.comment {
  color: #75715e;
}
.punctuation.definition.method-parameters,
.punctuation.definition.function-parameters,
.punctuation.definition.parameters,
.punctuation.definition.separator,
.punctuation.definition.seperator,
.punctuation.definition.array {
  color: #f8f8f2;
}
.punctuation.definition.heading,
.punctuation.definition.identity {
  color: #66d9ef;
}
.punctuation.definition.bold {
  color: #f6aa11;
  font-weight: bold;
}
.punctuation.definition.italic {
  color: #ae81ff;
  font-style: italic;
}
.punctuation.section.embedded {
  color: #881e1e;
}
.punctuation.section.method,
.punctuation.section.class,
.punctuation.section.inner-class {
  color: #f8f8f2;
}
.support.constant {
  color: #66d9ef;
}
.support.function {
  color: #66d9ef;
}
.support.function.any-method {
  color: #66d9ef;
}
.support.function.decl {
  color: #a6e22e;
}
.support.type,
.support.class {
  font-style: italic;
  color: #66d9ef;
}
.storage {
  color: #f92672;
}
.storage.type {
  font-style: italic;
  color: #66d9ef;
}
.string {
  color: #e6db74;
}
.string.regexp {
  color: #66d9ef;
}
.string.regexp .source.ruby.embedded {
  color: #f6aa11;
}
.string.other.link {
  color: #ec3533;
}
.variable {
  color: #f6aa11;
}
.variable.interpolation {
  color: #fd971f;
}
.variable.parameter {
  font-style: italic;
  color: #fd971f;
}
.variable.language.js {
  color: #f92672;
}
